	add("queensland", "{\"term\":\"queensland\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of the six states of Australia, occupying the north-eastern part of the continent, with its capital at Brisbane\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1859 - 1901) The self governing colony of what is now the state of Queensland\", \"priority\":2}]}, \"synonyms\":{}}");

	add("queenslander", "{\"term\":\"queenslander\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Queensland|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person from Queensland\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1977\u0027\u0027, \u00271977 Proceedings: Sixty-Eighth Annual Convention of Rotary International\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In view of the rapid development of Queensland, our prosperity and our major contribution to the nation and to world trade, I believe it is significant that a \u0027\u0027Queenslander\u0027\u0027 should be honoured with such a high position in Rotary\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Mark Browning, \u0027Rod Marsh: A Life in Cricket\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In reality the selectors\u0027 decision was between Marsh and John Maclean and the \u0027\u0027Queenslander\u0027\u0027 got the nod\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Darryl Greer, \u0027The Election\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Takada had the added advantage of being a \u0027\u0027Queenslander\u0027\u0027, although from the other end of the state. But to a native north \u0027\u0027Queenslander\u0027\u0027, that was better than being from Melbourne\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A house built in an architectural style found in Queensland, that style being wide verandahs around the house and the house raised up on stumps about 2 metres off the ground\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Ross Fitzgerald, \u0027\u0026quot;Red Ted\u0026quot;: the life of E. G. Theodore\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Originally built in 1907 and designed by New Zealand-born architect RS (Robin) Dods, Alma-den was a high-set \u0027\u0027Queenslander\u0027\u0027, with a large verandah around three sides of the house. Underneath in the front, Ted had a small study-cum-library-cum-hobby space, and from the time the family moved to New Farm he began to collect a library\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Darroch Donald, \u0027Footprint East Coast Australia: Sydney to Cairns\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"is a conveniently located 4-star B\u0026amp;B in a restored traditional \u0027\u0027Queenslander\u0027\u0027, offering 6 spacious en suites and 1 luxury suite with spa, pool and off-street parking\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Frank Stewart, Larissa Behrendt, Barry Lopez, \u0027Where The Rivers Meet: New Writing from Australia\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Any house built substantially of wood and lasting more than twenty years is now a \u0026quot;\u0027\u0027Queenslander\u0027\u0027\u0026quot; it seems and commands a premium\", \"priority\":14}]}, \"synonyms\":{}}");

	add("queerbait", "{\"term\":\"queerbait\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|queer|bait|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A man who is attractive to homosexuals\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, James Lee Burke, \u0027Dixie City Jam\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A couple of them are UNO pukes; the others are just ugly and stupid or probably latent \u0027\u0027queerbait\u0027\u0027 themselves. Anyway, they\u0027re always on the prowl for fresh meat down in the Quarter\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Robin Tamblyn, \u0027King of Hollywood\u0027 (page 44\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"“Cause you\u0027d fuck anything, wouldn\u0027t you, \u0027\u0027queerbait\u0027\u0027, you little queer. I bet you\u0027ve even fucked your own father!” Stunned silence at this\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Josh Emmons, \u0027The loss of Leon Meed\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A fucking stranger had come between them and now here was a flaming \u0027\u0027queerbait\u0027\u0027 ruining his chances for a sale\", \"priority\":7}]}, \"synonyms\":{}}");

	add("queerdar", "{\"term\":\"queerdar\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|queer|dar|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The supposed ability to detect whether or not a person is queer by observing that person\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Rick Hoffman, account of the , \u0027Memorandum from the Pro-Life Alliance of Gays and Lesbians\u0027, Number 46, Summer 2004, [http://www.plagal.org/news/plagal46.pdf page 3\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"During that march, my \u0027\u0027queerdar\u0027\u0027 was on full throttle. I saw HRC equality and rainbow stickers all over the place\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Jason Edwards, \u0027Eve Kosofsky Sedgwick\u0027, Routledge (2009), ISBN 9781134244973, [https://books.google.com/books?id\u003dRa1Qq5PCnB4C\u0026amp;pg\u003dPA46\u0026amp;dq\u003d%22queerdar%22 page 46\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Are there such things as \u0027gaydar\u0027 or \u0027\u0027queerdar\u0027\u0027? That is to say, do some individuals possess an uncanny ability to recognise someone or something as gay or queer and to acknowledge it publicly\", \"priority\":5}]}, \"synonyms\":{}}");

