	add("quentin", "{\"term\":\"quentin\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Old french (842-ca. 1400) Name of a third century French martyr, from Latin Quintinus, derivative of the Roman praenomen Quintus, from quintus (\u0026quot;fifth\u0026quot;). It was brought to England by Normans, but never became particularly popular.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027 w:Maeve Maeve Binchy, \u0027Quentins\u0027, Orion, ISBN 0752851659, page 79\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Quentin\u0027\u0027 Barry had always wished that he had been called Sean or Brian. It was hard to be called \u0027\u0027Quentin\u0027\u0027 at a Christian Brothers school in the 1970s. But that was the name they had wanted, his beautiful mother Sara Barry had wanted, she who had always lived in a dream world far more elegant that the one she really lived in\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"occasionally used\", \"priority\":3}]}, \"synonyms\":{}}");

