	add("quern", "{\"term\":\"quern\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"English\", \"middle english (1100-1500)\", \"northern frisian\", \"middle high german (ca. 1050-1500)\", \"Dutch\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) \u0027quern\u0027 \u0027cwerne\u0027 from Old english (ca. 450-1100) \u0027cweorn\u0027 (quern, hand-mill, mill) from Proto-germanic {{m|gem-pro|*kwernuz}}, {{m|gem-pro|*kwernō||millstone}}, from Proto-indo-european {{m|ine-pro|*gʷérh₂nus||millstone}}. Cognate with Northern frisian \u0027quern\u0027 (quern) Dutch \u0027kweern\u0027 (quern) Middle high german (ca. 1050-1500) \u0027kurn\u0027 (millstone) Danish \u0027kværn\u0027 (grinder) Swedish \u0027kvarn\u0027 (mill, grinder)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mill for grinding corn, especially a hand-mill made of two circular stones\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1978\u0027\u0027, Robert Nye, \u0027Merlin\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"She is shaking in ingredients from various small bottles and \u0027\u0027querns\u0027\u0027 produced from the pockets of her robes, and from the drawer in the wooden table\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Anne Crone, Ewan Campbell, \u0027A Crannog of the First Millennium, AD: Excavations by Jack Scott at Loch Gloshan, Argyll, 1960\u0027, [http://books.google.com.au/books?id\u003dH-0hM1yexioC\u0026amp;pg\u003dPA100\u0026amp;dq\u003d%22querns%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003du-hEU_6tCsKbkAWuoIGoBA\u0026amp;redir_esc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22querns%22\u0026amp;f\u003dfalse page 100\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"MacKie has noted that \u0027\u0027querns\u0027\u0027 that were in use in Scotland up to the present day were about 450mm—600mm in diameter and that the lower stone was completely perforated to make it adjustable (MacKie 1987, 5\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Charles D. Hockensmith, \u0027The Millstone Industry\u0027, [http://books.google.com.au/books?id\u003ddOgUSeTAXaQC\u0026amp;pg\u003dPA212\u0026amp;dq\u003d%22querns%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003du-hEU_6tCsKbkAWuoIGoBA\u0026amp;redir_esc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22querns%22\u0026amp;f\u003dfalse page 212\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Not surprisingly, different cultures discovered the suitability of various rock types for manufacturing \u0027\u0027querns\u0027\u0027 and millstones\", \"priority\":9}]}, \"synonyms\":{}}");

	add("query", "{\"term\":\"query\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"An anglicisation of \u0027\u0027 an obsolete variant form of Latin \u0027quaere\u0027 second-person singular present active imperative of \u0027quaerō\u0027 (seek, look for; ask) Compare {{l|en|question}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A question, an inquiry , an enquiry\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The teacher answered the student\u0027s \u0027\u0027query\u0027\u0027 concerning biosynthesis\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A question mark\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Oliver Sacks, \u0027Awakenings\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"She had written in her diary: \u0026quot;I don\u0027t \u0027think\u0027 I am in a concentration-camp??????\u0026quot;, the \u0027\u0027queries\u0027\u0027 growing larger and more numerous till they covered the entire page\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, \u0026quot;Pip\u0026quot;, \u0027Re: Royal Enfield motorbike - why would anyone buy one?\u0027 (on newsgroup \u0027rec.motorcycles\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"I refer you to your line above, where you use a \u0027\u0027query\u0027\u0027 and a bang together\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A set of instructions passed to a database\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The database admin switched on \u0027\u0027query\u0027\u0027 logging for debugging purposes\", \"priority\":9}]}, \"synonyms\":{}}");

